function Page() {
  const photos = [
    {photo:Photo1,
     text:"Interior of The Good Fork"
    },
    {photo:Photo2,
     text:"Heuvos Rancherritos"
    },
]

  return (

    <div className="Page">
      <Content/>
      <Photo/>
    </div>
  );
}

export default Page;
